Week5/Keccak256.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract Keccak256 {
    event Log(bytes32 data);

    function encode(string memory s1, string memory s2) external returns(bytes32 me) {
        return keccak256(abi.encode(s1, s2));
    }

    function encodePacked(string memory s1, string memory s2) external {
        emit Log(keccak256(abi.encodePacked(s1, s2)));
    }
}

